import React from "react";
import Header from "../commons/Header";
import Footer from "../commons/Footer";

function MainPage() {
  return (
    <div>
      <Header />
      <button>Login</button>
      <button>Register</button>
      <Footer />
    </div>
  );
}

export default MainPage;
